$(document).ready(function () {
    function updateTable(data) {
        var report_name = $("#process_name").find('option:selected').text();

        var tableId = "tableExport2";
        // Create table element
        var table = document.createElement('table');
        table.id = tableId;
        table.classList.add('display');
        table.classList.add('table');
        table.classList.add('cell-border');

        // Create table head
        var thead = document.createElement('thead');
        var elearningColumns;
        // Update headers based on course_details and process_name values
        if (course_details.value === "1") {
            elearningColumns = ["Name", "Course Name", "Get Certified", "Enroll Date", "Completion Date", "Course Status"];
        } else if (process_name.value === "6" && course_details.value == "2") {
            elearningColumns = ["Event Name", "Event description", "Event Date"];
        } else if (process_name.value === "6" && course_details.value == "3") {
            elearningColumns = ["Notice name", "Notice description", "Author", "Notice Date"];
        }
        const moduleTableHeaders = {
            "1": ["Name", "Email", "Role", "Registerd Date", "Status"],
            "2": ["Firm name", "Partners Name", "Registered date", "Status"],
            "3": ["User name", "Licence Number", "Registered date", "Renewal Date", "Status"],
            "4": ["GT Name", "Councelor", "Councelor Status", "Supervisor", "Supervisor Status", "GT Status"],
            "5": [" Instruction Name", "Valuer Name", "Type", "Status"],
            "6": elearningColumns,
            "8": ["Name", "Transaction Id", "Amount", "Type", "Payment Date"],
        };
        var headerRow = document.createElement('tr');
        moduleTableHeaders[moduleDropdown.value].forEach(function (header) {
            var th = document.createElement('th');
            th.textContent = header;
            headerRow.appendChild(th);
        });
        thead.appendChild(headerRow);
        table.appendChild(thead);

        // Create table body
        var tbody = document.createElement('tbody');
        data.forEach(function (rowData) {
            var row = document.createElement('tr');
            for (var key in rowData) {
                console.log(key);

                var cell = document.createElement('td');
                cell.textContent = rowData[key];
                if (key === "name") {
                    let name = rowData[key];
                    name = name.charAt(0).toUpperCase() + name.slice(1);
                    cell.textContent = name;
                } else if (key === "active_flag") {
                    if (rowData[key] === 0) {
                        cell.textContent = "Active";
                    } else if (rowData[key] === 1) {
                        cell.textContent = "De-active";
                    }
                } else if (key === "status") {
                    if (rowData[key] == "0") {
                        cell.textContent = "Active";
                    } else if (rowData[key] == "1") {
                        cell.textContent = "Expired";
                    } else if (rowData[key] == "2") {
                        cell.textContent = "Not Acquired";
                    } else if (rowData[key] == "Approved") {
                        cell.textContent = "Approved";
                    } else if (rowData[key] == "Pending") {
                        cell.textContent = "Pending";
                    } else if (rowData[key] == "Rejected") {
                        cell.textContent = "Rejected";
                    }
                }
                else if (key === "event_description") {
                    cell.innerHTML = rowData[key];
                }
                else if (key === "notice_description") {
                    cell.innerHTML = rowData[key];
                }
                row.appendChild(cell);
            }
            tbody.appendChild(row);
        });
        table.appendChild(tbody);

        // Append table to container
        var container = document.querySelector('#report_table .tableDiv');
        container.innerHTML = ''; // Clear existing content
        container.appendChild(table);

        // Initialize DataTable
        $('#' + tableId).DataTable({
            dom: 'TBfrtip',
            retrieve: true,
            bdestroy: true,
            "lengthMenu": [
                [10, 50, 100, 250, -1],
                [10, 50, 100, 250, "All"]
            ],
            ServerSide: true,
            buttons: [{
                extend: 'excel',
                title: 'MLHUD VPP - ' + report_name,
            }, {
                extend: 'pdfHtml5',
                orientation: 'portrait',
                pageSize: 'A4',
                footer: true,
                title: 'MLHUD VPP - ' + report_name,

                customize: function (doc) {
                    doc.content.splice(0, 0, {

                        margin: [0, 0, 0, 0],
                        alignment: 'left',
                        image:
                            'data:image/png;base64,',
                        width: 40,
                        height: 40,
                    });
                    doc['footer'] = (function (page, pages) {
                        return {
                            columns: [

                                {
                                    alignment: 'center',
                                    text: [
                                        { text: page.toString(), italics: true },
                                        ' of ',
                                        { text: pages.toString(), italics: true }
                                    ]
                                }
                            ],
                            margin: [40, 10]
                        }
                    });
                    doc.content.splice(1, 0, {
                        text: '',
                        fontSize: 20,
                        alignment: 'center',
                        margin: [0, 0] // Adjust margins as needed
                    });
                    function generateTimestamp() {
                        const now = new Date();
                        const options = { year: 'numeric', month: 'short', day: 'numeric', hour: '2-digit', minute: '2-digit', second: '2-digit' };
                        return now.toLocaleString('en-US', options);
                    }
                    doc['header'] = function (page, pages, pageSize) {
                        return {
                            columns: [
                                { text: generateTimestamp(), alignment: 'right', margin: [10, 10] }
                            ],
                            margin: [10, 10]
                        };
                    };

                    if (doc.content[1] && doc.content[1].table) {
                        // Add border to all table cells
                        doc.content[1].table.body.forEach(function (row) {
                            row.forEach(function (cell) {
                                cell['border'] = [1, 1, 1, 1]; // [left, top, right, bottom]
                                cell['lineColor'] = [0, 0, 0];
                            });
                        });
                    }
                    doc.pageMargins = [40, 40, 40, 40];

                }

            },

            {
                extend: 'print',
                title: 'MLHUD VPP - ' + report_name,
            }]
        });
    }


    function ajaxCall() {
        $('#report_table').hide();
        var report_name;
        var module_name = $("#module_name").val();
        if (module_name == 0) {
            swal.fire({
                title: "Error",
                text: "Please select the Module Name",
                icon: "error",
            });
            return false;
        }

        var process_name = $("#process_name").val();
        if (process_name == 0) {
            swal.fire({
                title: "Error",
                text: "Please select the Process Name",
                icon: "error",
            });
            return false;
        }

        var filter_by = $("#filter_by").val();
        var status = $("#status").val();
        if (filter_by != 0 && status == 0) {
            swal.fire({
                title: "Error",
                text: "Please select the Status ",
                icon: "error",
            });
            return false;
        } else {
            var from_date = $('#from_date').val();
            var to_date = $('#to_date').val();
            var status_by = $('#status_by').val();
            var role_by = $('#role_by').val();
            var license_by = $('#license_by').val();
            var license_status = $('#license_status').val();
            var gtstatus = $('#gtstatus').val();
            var valuer_type = $('#valuer_type').val();
            var valuer_status = $('#valuer_status').val();
            var payment_type = $('#payment_type').val();
            var course_details = $('#course_details').val();
            var courselist = $('#courselist').val();

            $.ajax({
                url: reportURL,
                type: 'GET',
                data: {
                    module_name: module_name,
                    process_name: process_name,
                    from_date: from_date,
                    to_date: to_date,
                    status_by: status_by,
                    role_by: role_by,
                    license_by: license_by,
                    license_status: license_status,
                    gtstatus: gtstatus,
                    valuer_status: valuer_status,
                    valuer_type: valuer_type,
                    payment_type: payment_type,
                    course_details: course_details,
                    courselist: courselist,
                    _token: token
                },
                success: function (data) {
                    $('#tableExport2').remove();
                    updateTable(data);
                    $('#report_table').show();
                }
            });
        }
    }

    document.getElementById("search_button").addEventListener("click", ajaxCall);
});
